import 'dart:convert';

import 'package:flutter_riverpod/flutter_riverpod.dart';
import 'package:http/http.dart' as http;
import 'package:nasi_igut_han/models/settings.dart';

class SettingsNotifier extends StateNotifier<Settings> {
  SettingsNotifier()
      : super(Settings(
            logo: defaultImage,
            title: '',
            quote: '',
            aboutUs: '',
            banner: defaultImage,
            background: defaultImage));

  Future<void> load() async {
    final res = await http.get(
      Uri.parse(
        '${const String.fromEnvironment('API_URL')}/settings',
      ),
      headers: {'Content-Type': 'application/json'},
    );

    final resBody = jsonDecode(res.body);

    final bool status = resBody['status'];

    if (!status) return;

    final Map doc = resBody['doc'];

    state = Settings.fromMap(doc);
  }

  Future<bool> set(Settings value) async {
    final res = await http.put(
      Uri.parse(
        '${const String.fromEnvironment('API_URL')}/settings',
      ),
      headers: {'Content-Type': 'application/json'},
      body: value.toJson(),
    );

    final bool status = jsonDecode(res.body)['status'];

    // Jika gagal
    if (!status) return false;

    state = value;
    return true;
  }
}

final settingsProvider = StateNotifierProvider((ref) => SettingsNotifier());

const defaultImage =
    '';
